import React, { useState , useEffect }from 'react';
// import logo from './logo.svg';
import Book from '../src/objects/Book'
import logic from './logic'
import './App.css';

function App() {
  const [books , setBooks] = useState([])
  useEffect(()=>{
    async function retrieveBooks(){
      try {
        // const retrievedBooks = await logic.retrieveBooksFromAPI()
        setBooks(await logic.retrieveBooksFromAPI())
        console.log(books)
      } catch (error) {
        console.log(error)
      }
    }
    retrieveBooks()
  } , [setBooks])

  return (
    <div className="App">
      <header className="App-header">
        <h1>Google Books API</h1>
      </header>
      <section>

      </section>
    </div>
  );
}

export default App;
